let Icons = {
  calls: Calls,
  human: Human,
  vehicle: Vehicle,
  wanted: Wanted,
  database: Database
};
export default {
  components: {
    Calls,
    Human,
    Vehicle,
    Wanted,
    Database
  },
  props: {
    tabs: {
      type: Array,
      required: true
    },
    activeCalls: {
      type: Number,
      required: true
    }
  },
  methods: {
    getIcon(tab) {
      return Icons[tab.id];
    },
    showCount(tab) {
      return tab.id === "calls";
    }
  }
};
